import React, { useState } from "react";

function FoodTracking() {
  const [donationId, setDonationId] = useState("");
  const [trackingData, setTrackingData] = useState(null);
  const [error, setError] = useState("");

  // Simulated donation database
  const dummyData = {
    FD123456: { status: "Received", date: "2025-10-06" },
    FD654321: { status: "In Transit", date: "2025-10-05" },
    FD789012: { status: "Delivered", date: "2025-10-04" },
  };

  const handleTrack = (e) => {
    e.preventDefault();
    if (dummyData[donationId]) {
      setTrackingData(dummyData[donationId]);
      setError("");
    } else {
      setTrackingData(null);
      setError("‚ùå Donation ID not found! Please check and try again.");
    }
  };

  const getStatusStyle = (status) => {
    switch (status) {
      case "Received":
        return { color: "orange" };
      case "In Transit":
        return { color: "blue" };
      case "Delivered":
        return { color: "green" };
      default:
        return {};
    }
  };

  return (
    <div className="tracking-page" style={{ textAlign: "center", padding: "40px" }}>
      <h1>üçΩÔ∏è Track Your Food Donation</h1>
      <p>Enter your Donation ID below to view the delivery status.</p>

      <form onSubmit={handleTrack} style={{ marginTop: "30px" }}>
        <input
          type="text"
          placeholder="Enter Donation ID (e.g., FD123456)"
          value={donationId}
          onChange={(e) => setDonationId(e.target.value)}
          required
          style={{
            padding: "10px",
            borderRadius: "8px",
            width: "300px",
            border: "1px solid #aaa",
          }}
        />
        <button
          type="submit"
          style={{
            marginLeft: "10px",
            padding: "10px 20px",
            backgroundColor: "#007bff",
            color: "white",
            border: "none",
            borderRadius: "8px",
            cursor: "pointer",
          }}
        >
          Track
        </button>
      </form>

      {error && <p style={{ color: "red", marginTop: "20px" }}>{error}</p>}

      {trackingData && (
        <div
          className="status-card"
          style={{
            marginTop: "40px",
            padding: "30px",
            border: "1px solid #ddd",
            borderRadius: "15px",
            width: "60%",
            margin: "auto",
            boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
          }}
        >
          <h3>
            Donation ID: <span style={{ color: "green" }}>{donationId}</span>
          </h3>
          <p>Date: {trackingData.date}</p>
          <h2 style={getStatusStyle(trackingData.status)}>
            Current Status: {trackingData.status}
          </h2>

          <div className="timeline" style={{ marginTop: "30px" }}>
            <div style={{ display: "flex", justifyContent: "space-around" }}>
              <div>
                <div
                  style={{
                    width: "20px",
                    height: "20px",
                    borderRadius: "50%",
                    backgroundColor:
                      trackingData.status === "Received" ||
                      trackingData.status === "In Transit" ||
                      trackingData.status === "Delivered"
                        ? "green"
                        : "#ccc",
                    margin: "auto",
                  }}
                ></div>
                <p>Received</p>
              </div>
              <div>
                <div
                  style={{
                    width: "20px",
                    height: "20px",
                    borderRadius: "50%",
                    backgroundColor:
                      trackingData.status === "In Transit" ||
                      trackingData.status === "Delivered"
                        ? "green"
                        : "#ccc",
                    margin: "auto",
                  }}
                ></div>
                <p>In Transit</p>
              </div>
              <div>
                <div
                  style={{
                    width: "20px",
                    height: "20px",
                    borderRadius: "50%",
                    backgroundColor:
                      trackingData.status === "Delivered" ? "green" : "#ccc",
                    margin: "auto",
                  }}
                ></div>
                <p>Delivered</p>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default FoodTracking;
